Great British Railway Journeys Series 3

Travel Documentary hosted by Michael Portillo, published by BBC in 2012 - English narration


Information
------------------------------

Great British Railway Journeys Series 3
Michael Portillo takes to the tracks with a copy of George Bradshaw's Victorian Railway Guidebook. In a series of five epic journeys, Portillo travels the length and breadth of the country to see how the railways changed us, and what of Bradshaw's Britain remains.




16)  Berwick upon Tweed to Morpeth 
All this week he is travelling through some of northern England's most dramatic scenery, from Berwick-Upon-Tweed, crossing the Pennines to the Lake District before completing the journey on the beautiful and unique Isle of Man. Michael discovers the unique cross-border history of Berwick-Upon-Tweed, hears the unique story of the Pitman Painters of Ashington and sees first-hand the perils of working on the rails in Victorian times.



